g.script:
function init(evt) { if ( window.svgDocument == null ) svgDocument = evt.target.ownerDocument; }
function fmtT(val, div) {
  if (div > 100) return Math.floor((val-320)*div/64) + " ms";
  if (div > 0.025) return Math.floor((val-320)*div*1000/64)/1000 + " ms";
  return Math.floor((val-320)*div*1000*1000/64)/1000 + " us";
}
function fmtU(val, div, shift) { shift *= -60/25; return Math.floor((240-val+shift)*div/60) + " mV"; }
function msMove (evt)
{
	var x = evt.clientX;
	var y = evt.clientY;
	if (x < 0 || y < 0 || x >= 640 || y >= 480)
		return;
	svgDocument.getElementById("CH1").firstChild.data = fmtU(y, 100, 0) + " " + fmtT(x, 50);
	svgDocument.getElementById("CHC").firstChild.data = fmtU(y, 50, 0) + " " + fmtT(x, 0.005);
}
